import React, { useState } from 'react';
import axios from 'axios';

const CreatePackage = () => {
  const [formData, setFormData] = useState({
    courier: { id: '' },
    payOnDelivery: false,
    status: 'NEW',
    createdOn: '',
    deliveryAddress: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;

    // Handle nested courier.id
    if (name === 'courierId') {
      setFormData((prev) => ({
        ...prev,
        courier: { ...prev.courier, id: value },
      }));
    } else {
      setFormData((prev) => ({
        ...prev,
        [name]: value,
      }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:8081/package/create-package', formData);
      console.log('Package created:', response.data);
      alert('Package created successfully!');
    } catch (error) {
      console.error('Error creating package:', error);
      alert('Failed to create package. Please try again.');
    }
  };

  return (
    <div>
      <h2>Create Package</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Courier ID:</label>
          <input
            type="number"
            name="courierId"
            value={formData.courier.id}
            onChange={handleChange}
            placeholder="Enter courier ID"
            required
          />
        </div>
        <div>
          <label>Delivery Address:</label>
          <input
            type="text"
            name="deliveryAddress"
            value={formData.deliveryAddress}
            onChange={handleChange}
            placeholder="Enter delivery address"
            required
          />
        </div>
        <div>
          <label>Pay on Delivery:</label>
          <input
            type="checkbox"
            name="payOnDelivery"
            checked={formData.payOnDelivery}
            onChange={(e) =>
              setFormData((prev) => ({ ...prev, payOnDelivery: e.target.checked }))
            }
          />
        </div>
        <div>
          <label>Status:</label>
          <select name="status" value={formData.status} onChange={handleChange} required>
            <option value="NEW">NEW</option>
            <option value="PENDING">PENDING</option>
            <option value="DELIVERED">DELIVERED</option>
          </select>
        </div>
        <div>
          <label>Created On:</label>
          <input
            type="datetime-local"
            name="createdOn"
            value={formData.createdOn}
            onChange={handleChange}
            required
          />
        </div>
        <button type="submit">Create Package</button>
      </form>
    </div>
  );
};

export default CreatePackage;
